import React, { useState } from 'react';
import { AiOutlineClose, AiOutlineMenu } from 'react-icons/ai';

const Navbar = () => {
  const [nav, setNav] = useState(false);

  const handleNav = () => {
    setNav(!nav);
  };

  return (
    <div className='bg-white flex justify-between items-center max-w-[1400px] mx-auto h-24 px-2 text-black'>
      <h1 className='w-full text-3xl font-bold text-primary ml-4 text-blue-600'>Hemant</h1>
      <ul className='hidden md:flex text-lg font-medium text-slate-700'>
        <li className='px-4 cursor-pointer hover:text-blue-500 md:px-5'>Home</li>
        <li className='px-4 cursor-pointer hover:text-blue-500'>About</li>
        <li className='px-4 cursor-pointer hover:text-blue-500'>Skills</li>
        <li className='px-4 cursor-pointer hover:text-blue-500'>Portfolio</li>
        <li className='px-4 cursor-pointer hover:text-blue-500'>Contact</li>
      </ul>
      <div onClick={handleNav} className='block md:hidden'>
        {nav ? <AiOutlineClose size={20} /> : <AiOutlineMenu size={20} />}
      </div>
      <div className={nav ? 'fixed left-0 top-0 w-[70%] h-full bg-white border-r ease-in-out duration-500' : 'fixed left-[-100%]'}>
      <h1 className='text-3xl text-primary m-4 text-blue-600'>Hemant</h1>
        <ul className='text-2xl text-primary p-4'>

          <li className='p-2'>Home</li>
          <li className='p-2'>About</li>
          <li className='p-2'>Skills</li>
          <li className='p-2'>Portfolio</li>
          <li className='p-2'>Contact</li>
        </ul>
      </div>
    </div>
  );
}

export default Navbar;
